import React from "react";
import '../App.css';
import $ from 'jquery';
import { Button } from "@material-ui/core";

export default function About(){

    return(
        <div style={bfImgA}>
        <div className="containerAbt">
            <div className="abt-left-box">
                <div className="participateHead">
                    <h2>About this Event</h2>
                </div>

                <div className="participatePara">
                    <span>Open to students of Sri Lanka <br/>Institute of Information Technology (SLIIT), <br/>Who interest in joining <br/><span style={{fontWeight:700}}>Mozilla Campus Club of SLIIT.</span></span>
                </div>
            </div>

            <div className="abt-right-box">
                {/* <Button className="btn-grad">
                <a style={{ textDecoration: "none" }} >
                    REGISTER NOW
                    </a>
                </Button> */}
                <div className="abtText">
                    <span className="abt21">21st</span><br/>
                    <span className="tuesday">TUESDAY</span><br/>
                    <span className="december">December</span><br/>
                    <span className="time">7.00 pm</span><br/>
                    <span className="zoom">via ZOOM</span>
                </div>
            </div>
            {/* <img className="watermark" src="https://res.cloudinary.com/fitness-glory/image/upload/v1639484985/logo_icon-01_s6oex8.png"/> */}
        </div>
        </div>
    )
}

const intBg =
  "https://res.cloudinary.com/fitness-glory/image/upload/v1633216239/young-woman-drinking-water-gym-exercise-concept_1_gtwi3b.jpg";
const bgImgA = {
  background: `linear-gradient( rgba(0, 0, 0, 0.2), rgba(0, 0, 0, 0.2)) ,url(${intBg})`,
  backgroundSize: "cover",
  position: "center",
  marginTop: "-20px",
  right: "0%",
  left: "0%",
  width: "100%",
  height: "100%",
};
